import React from 'react'
import { Nav, Navbar } from 'react-bootstrap'
import styled from 'styled-components'
import { Link } from 'react-router-dom'

const NavStyle = styled.div`
  .navbar {
    background-color: black;
  }
  .navbar-brand {
    color: white;
    font-family: 'Indie Flower', cursive;
    &:hover {
      color: gold;
    }
  }
  a, .navbar-nav .nav-link {
    color: gold;
    font-family: 'Courgette', cursive;
    &:hover {
      text-decoration: none;
      color: white;
    }
  }
  .custom-toggler.navbar-toggler {
    border-color: black;
  }
  .custom-toggler .navbar-toggler-icon {
    background-image: url("data:image/svg+xml;charset=utf8,%3Csvg viewBox='0 0 32 32' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath stroke='gold' stroke-width='2' stroke-linecap='round' stroke-miterlimit='10' d='M4 8h24M4 16h24M4 24h24'/%3E%3C/svg%3E");
  }
`

function NavBar (props) {
  return (
    <NavStyle>
      <Navbar expand='lg'>
        <Navbar.Brand href='/'>Wealthy app</Navbar.Brand>
        <Navbar.Toggle aria-controls='basic-navbar-nav' className='navbar-toggler navbar-toggler-right custom-toggler' />
        <Navbar.Collapse id='basic-navbar-nav'>
          {localStorage.token === undefined 
            ? <Nav className='ml-auto'>
              <Nav.Item>
                <Nav.Link>
                  <Link to='/login'>Login</Link>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link>
                  <Link to='/register'>Sign up</Link>
                </Nav.Link>
              </Nav.Item>
            </Nav>
            : <Nav className='ml-auto'>
              <Nav.Item>
                <Nav.Link>
                  <Link to='/'>Dashboard</Link>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link>
                  <Link to='/gold'>Gold</Link>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link>
                  <Link to='/silver'>Silver</Link>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link>
                  <Link to='/cash'>Cash</Link>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link>
                  <Link to='/logout'>Logout</Link>
                </Nav.Link>
              </Nav.Item>
            </Nav>}
        </Navbar.Collapse>
      </Navbar>
    </NavStyle>
  )
}

export default NavBar
